import React from "react";
import {Container, ContentSection, TitleCont, NumberCont, TextCont } from "./styles";

/*import {ReactComponent as CPUSvg} from "../../assets/svg/cpu.svg";*/


const Title = ({children}: {children: string}) =>{
    return <TitleCont>{children}</TitleCont>
}
const Number = ({children}: {children: string})=>{
    return <NumberCont>{children}</NumberCont>
}
const Text = ({children}: {children: React.ReactNode})=>{
    return <TextCont>{children}</TextCont>
}
const WhatIs:React.FC = ()=>{
    return(
        <ContentSection>
            <Container>
                <Number>1.</Number><Title>Bem-Vindo à engenharia de computação!</Title>

            </Container>
        </ContentSection>
    );
}

export default WhatIs;
